import React, { useEffect, useState } from "react";
import axios from 'axios';
import Swal from "sweetalert2";
import Card from "./Card.jsx";
import '../asset/style/containerCard.css'


import {CardGroup, CardImg, CardColumns, CardHeader } from 'reactstrap';


function Upimg() {

    const [data, setData] = useState([0])

    useEffect(() => {
        axios.get('http://localhost:3000/api/product/view')
            .then(res => {
                console.log(res.data)
                setData(res.data)
            })
            .catch(err => {
                console.log(err)
            })
    }, [])


    const postDelete = (id, e) => {
        e.preventDefault();
        axios.delete(`http://localhost:3000/api/img/eliminar?id=${id}`)
            .then(res => console.log(res))
            .catch(err => console.log(err))
        Swal.fire({
            title: 'Eliminando...',
            text: 'Usuario de Id: ' + id + ' Eliminado',
            icon: 'warning',
            confirmButtonText: 'Ok'
        })
    }

    return (
        <CardGroup className="container-card-Upimg">
           <Card/>
        </CardGroup>

    )



}

export default Upimg;
